import { takeEvery } from 'redux-saga/effects'
import ShopActionTypes from './shop.types'

export function* fetchCollAsync(){
    yield console.log('I am groot')
}

export function* fetchCollStart(){
    yield takeEvery(
        ShopActionTypes.FETCH_COLL_START,
        fetchCollAsync
    )
}
